import React from 'react';

function Food({ name }) {
  return (
    <h1>I like {name}</h1>
  );
}

const foorILike = ['kim', 'park', 'choe'];

function App() {
  return (
    <div>
      <h1>Hello!!</h1>
      {foorILike.map((dish) => {
        return <Food name="{dish.name}" />;
      })}
    </div>
  );
}

export default App;
